import React from 'react';
import errorMessages from './error-messages';
import spinner from './spinner.svg';
import { fetchLists } from './services';

const users = (usersList) => {
    const userList = {};
    fetchLists()
    .then( (usersMessagesList) => {
      userList = usersMessagesList.userList; // inform parent
    })
    .catch( (err) => {
      setError(errorMessages[err.code || 'DEFAULT']);
      setIsLoading(false);
    });
    const temp =  `<ul className="users">` +
    Object.values(usersList).filter( user => user.active).map( user => `
    <li>
        <div className="user">
            <span className="username">${user.username}</span>
        </div>
    </li>
    `).join('') +
`</ul>`;
    return (
        <div>
            {temp}
